string input = "";
Queue<char> packets = new();
MarkerLocations(input, 4, packets);
MarkerLocations(input, 14, packets);

static void MarkerLocations(string input, int quantity, Queue<char> packets) {
  for (int i = 0; i < input.Length; i++) {

    packets.Enqueue(input[i]);

    if (packets.Count > quantity) {
      packets.Dequeue();
    }

    if (packets.Distinct().Count() == quantity) {
      Console.WriteLine($"{i + 1} Packets Processed");
      break;
    }
  }
}
